static void int_to_hex(X2C_INT32 int0, LongStrs_String * str)
{
   X2C_CHAR digit[2];
   X2C_INT32 n;
   X2C_CARD32 card;
   card = (X2C_CARD32)int0;
   digit[1UL] = 0;
   do {
      n = (X2C_INT32)(card&15UL);
      if (n<10L) digit[0UL] = (X2C_CHAR)(n+48L);
      else digit[0UL] = (X2C_CHAR)((n-10L)+65L);
      LongStrs_Insert(digit, 2ul, 0L, str);
      card = card/16UL;
   } while (card);
   if ((X2C_CARD8)(*str)->Adr[0UL]>='A' && (X2C_CARD8)(*str)->Adr[0UL]<='F') {
      digit[0UL] = '0';
      LongStrs_Insert(digit, 2ul, 0L, str);
   }
   LongStrs_AppendChar('H', str);
} /* end int_to_hex() */


