extern LongStrs_String H2DObjs_GetText(H2DObjs_ConstantValue val,
                X2C_BOOLEAN string)
{
   LongStrs_String s = 0;
   X2C_CHAR a[32];
   LongStrs_String anonym = 0;
   LongStrs_String anonym0 = 0;
   s = 0;
   if (LongStrs_Length1(val->str)>0L && string) {
      anonym = val->str;
      LongStrs_Assign(anonym->Adr, anonym->Len0, &s);
   }
   else {
      switch (val->type) {
      case 6072L:
         if (val->hex) int_to_hex(val->int0, &s);
         else {
            WholeStr_IntToStr(val->int0, a, 32ul);
            LongStrs_Assign(a, 32ul, &s);
         }
         break;
      case 6073L:
         if (val->hex) int_to_hex((X2C_INT32)val->uint, &s);
         else {
            WholeStr_IntToStr((X2C_INT32)val->uint, a, 32ul);
            LongStrs_Assign(a, 32ul, &s);
         }
         break;
      case 6076L:
         LongStrs_RealToStr(val->real, &s);
         break;
      case 6031L:
      case 6030L:
         anonym0 = val->str;
         LongStrs_Assign(anonym0->Adr, anonym0->Len0, &s);
         break;
      default:
         X2C_TRAP(X2C_CASE_TRAP);
      } /* end switch */
   }
   return s;
} /* end GetText() */


