extern void H2DObjs_ComputeExpression3(H2DObjs_Value expr,
                H2DObjs_ConstantValue * res, X2C_BOOLEAN limex)
{
   X2C_CARD8 r;
   LongStrs_String anonym = 0;
   LongStrs_String anonym0 = 0;
   LongStrs_String anonym1 = 0;
   LongStrs_String anonym2 = 0;
   LongStrs_String anonym3 = 0;
   H2DObjs_Expression anonym4 = 0;
   X2C_SEQ tmp[3];
   H2DObjs_NewConstantValue(res);
   (*res)->hex = expr->hex;
   (*res)->type = expr->type;
   switch (expr->type) {
   case 6072L:
      anonym = expr->value;
      WholeStr_StrToInt(anonym->Adr, anonym->Len0, &(*res)->int0, &r);
      (*res)->str = X2C_CALL(H2DObjs_GetText_,X2C_GET_TD(*res),1)(*res, 1);
      break;
   case 6073L:
      anonym0 = expr->value;
      WholeStr_StrToCard(anonym0->Adr, anonym0->Len0, &(*res)->uint, &r);
      (*res)->str = X2C_CALL(H2DObjs_GetText_,X2C_GET_TD(*res),1)(*res, 1);
      break;
   case 6076L:
      if (limex) {
         Error(16L, (tmp[0].adr = "", tmp[1].val = 0, tmp[2].val = 1u-1,
                (X2C_LOC *)tmp), 3ul*sizeof(X2C_SEQ));
         return;
      }
      anonym1 = expr->value;
      LongStr_StrToReal(anonym1->Adr, anonym1->Len0, &(*res)->real, &r);
      (*res)->str = X2C_CALL(H2DObjs_GetText_,X2C_GET_TD(*res),1)(*res, 1);
      break;
   case 6030L:
      (*res)->type = 6072L;
      (*res)->int0 = (X2C_INT32)(X2C_INT16)(X2C_CARD8)(anonym2 = expr->value,
                anonym2->Adr[0UL]);
      break;
   case 6031L:
      if (limex) {
         Error(16L, (tmp[0].adr = "", tmp[1].val = 0, tmp[2].val = 1u-1,
                (X2C_LOC *)tmp), 3ul*sizeof(X2C_SEQ));
         return;
      }
      anonym3 = expr->value;
      LongStrs_Assign(anonym3->Adr, anonym3->Len0, &(*res)->str);
      break;
   case 6001L:
      H2DObjs_Deallocate((adt_Element)*res);
      anonym4 = expr->tobj->expr;
      X2C_CALL(H2DObjs_ComputeExpression_,X2C_GET_TD(anonym4),2)(anonym4,
                res, limex);
      if (LongStrs_Length1(expr->tobj->name)>0L) {
         H2DObjs_ValueHandler(expr->tobj, &(*res)->str);
      }
      break;
   default:
      X2C_TRAP(X2C_CASE_TRAP);
   } /* end switch */
} /* end ComputeExpression() */


